import axiosInstance from './axiosInstance';

const API = {};

// getCompositeSampleTypes
API.getCompositeSampleTypes = () => axiosInstance
  .get('composite_sample_types')
  .then((response) => response.data)
  .catch((error) => error);

export default API;
